import collectHomePageTableRows from "./collectHomeTableRows.mjs";
// import checkPathExists from "./checkPathExists.mjs";
import goToHomePage from "./goToHomePage.mjs";
import selectAttachmentDropdownOption from "./selectAttachmentDropdownOption.mjs";
import makeUserLoggedInOrOpenHomePage from "./makeUserLoggedInOrOpenHomePage.mjs";
import sleep from "./sleep.mjs";
import closePageSafely from "./closePageSafely.mjs";
import helpIncreaseDetailsPageRecaptchaScore from "./helpIncreaseDetailsPageRecaptchaScore.mjs";
import updateSuperAcceptanceApiData from "./updateSuperAcceptanceApiData.mjs";
import {
  USER_ACTION_TYPES,
  generatedPdfsPathForAcceptance,
  generatedPdfsPathForRejection,
  HOME_PAGE_URL,
  htmlFilesPath,
  acceptanceApiUrl,
  globMedHeaders,
  rejectionApiUrl,
} from "./constants.mjs";

// import humanClick from "./humanClick.mjs";
// import humanMouseMove from "./humanMouseMove.mjs";

const MAX_RETRIES = 8;
const buttonsSelector = "section.referral-button-container button";

const getSubmissionButtonsIfFound = async (page) => {
  try {
    await page.waitForSelector(buttonsSelector, {
      timeout: 870,
      // visible: true,
    });

    const buttons = await page.$$(buttonsSelector);

    if (buttons.length < 2) return false;

    return buttons;
  } catch (err) {
    console.log("❌ Failed to get submission buttons:", err.message);
    return false;
  }
};

const buildDurationText = (startTime, endTime) => {
  const executionDurationMs = endTime - startTime;

  const durationText = `🕒 *Took*: \`${(executionDurationMs / 1000).toFixed(
    2
  )} seconds\``;

  return durationText;
};

const processClientActionOnPatient = async ({
  browser,
  actionType,
  patient,
  patientsStore,
  sendWhatsappMessage,
}) => {
  let preparingStartTime = Date.now();

  // console.time("🕒 prepare_user_action_start_time");
  const phoneNumber = process.env.CLIENT_WHATSAPP_NUMBER;
  const CLIENT_NAME = process.env.CLIENT_NAME;

  const {
    referralId,
    patientName,
    referralEndTimestamp,
    isSuperAcceptance,
    providerName,
  } = patient;

  const isAcceptance = USER_ACTION_TYPES.ACCEPT === actionType;

  const actionName = isAcceptance ? "Acceptance" : "Rejection";

  const logString = `details page referralId=(${referralId})`;

  const acceptanceFilePath = join(
    generatedPdfsPathForAcceptance,
    `${USER_ACTION_TYPES.ACCEPT}-${referralId}.pdf`
  );

  const rejectionFilePath = join(
    generatedPdfsPathForRejection,
    `${USER_ACTION_TYPES.REJECT}-${referralId}.pdf`
  );

  const filePath = resolve(
    isAcceptance ? acceptanceFilePath : rejectionFilePath
  );

  const baseMessage = `🚨 *\`${actionName.toUpperCase()}\`* Case Alert! 🚨
🆔 Referral: *${referralId}*
👤 Name: _${patientName}_\n`;

  const [page, cursor, isLoggedIn] = await makeUserLoggedInOrOpenHomePage({
    browser,
    sendWhatsappMessage,
    startingPageUrl: HOME_PAGE_URL,
  });

  const sendSuccessMessage = async (durationText) => {
    try {
      const timeStamp = Date.now();
      const status = isAcceptance ? "Accepted" : "Rejected";

      await sendWhatsappMessage(phoneNumber, {
        message: `${baseMessage}✅ Status: *SUCCESS*\nPatient has been *${status}*\n${durationText}\n🕓 *timeStamp*: ${timeStamp}`,
      });

      console.log(`✅ ${status} ${durationText} in ${logString}`);
    } catch (error) {
      console.log("Error when sending whatsapp success data");
    }
  };

  const sendErrorMessage = async (reason, fileName, durationText = "") => {
    try {
      const timeStamp = Date.now();

      const fullMessage = `${baseMessage}❌ Status: *ERROR*\n*Reason*: ${reason}\n${durationText}\n🕓 *timeStamp*: ${timeStamp}`;

      await Promise.allSettled([
        sendWhatsappMessage(phoneNumber, { message: fullMessage }),
        fileName
          ? page.screenshot({
              path: `screenshots/${fileName}-for-${referralId}-${timeStamp}.png`,
            })
          : Promise.resolve(),
      ]);

      console.log(`❌ ${reason} ${durationText} in ${logString}`);
    } catch (error) {
      console.log("Error when sending whatsapp error data");
    }
  };

  const closeCurrentPage = async (navigateToHomePage) => {
    if (navigateToHomePage) {
      await goToHomePage(page);
    }
    await closePageSafely(page);
  };

  if (!isLoggedIn) {
    await sendErrorMessage(
      "Login failed after 3 attempts.",
      "user-action-no-loggedin",
      buildDurationText(preparingStartTime, Date.now())
    );
    await closeCurrentPage(false);
    return;
  }

  const referralIdRecordResult = await collectHomePageTableRows(
    page,
    referralId,
    4000
  );

  let { iconButton } = referralIdRecordResult || {};

  if (!iconButton) {
    console.log("referralIdRecordResult: ", referralIdRecordResult);
    await sendErrorMessage(
      "The Pending referrals table is empty or eye button not found.",
      "no-patients-in-home-table",
      buildDurationText(preparingStartTime, Date.now())
    );

    await closeCurrentPage(false);
    return;
  }

  const handleOnSubmitDone = async ({
    startTime,
    isAutoAccept,
    errorMessage,
    isDoneSuccessfully,
  }) => {
    const durationText = buildDurationText(startTime, Date.now());
    console.log("durationText", durationText);

    await sleep(isAutoAccept ? 1000 : 15_000);

    patientsStore.forceReloadHomePage();

    if (!isAutoAccept) {
      await sleep(15_000);
    }

    const isDashboardPage = page
      .url()
      .toLowerCase()
      .includes("dashboard/referral");

    const _isDoneSuccessfully = isAutoAccept
      ? isDoneSuccessfully
      : isDashboardPage;

    if (!_isDoneSuccessfully) {
      await sendErrorMessage(
        isAutoAccept
          ? errorMessage
          : "app didn't redirect to home after submission",
        `no-home-redirect-action-${actionName}`,
        durationText
      );

      await closeCurrentPage(!isDashboardPage);
      return;
    }

    await sendSuccessMessage(durationText);

    const deletionResponse = await patientsStore.removePatientByReferralId(
      referralId
    );

    // await Promise.allSettled([
    //   checkPathExists(acceptanceFilePath).then(
    //     (exists) => exists && unlink(acceptanceFilePath)
    //   ),
    //   checkPathExists(rejectionFilePath).then(
    //     (exists) => exists && unlink(rejectionFilePath)
    //   ),
    // ]);

    console.log(deletionResponse?.message);
    await closeCurrentPage(!isDashboardPage);
  };

  const isSupperAcceptanceOrRejection = isSuperAcceptance;
  // const isSupperAcceptanceOrRejection = isSuperAcceptance || !isAcceptance;

  let superAcceptanaceData = {
    apiUrl: isAcceptance ? acceptanceApiUrl : rejectionApiUrl,
    headers: { ...globMedHeaders, Accept: "text/plain" },
  };

  if (isSupperAcceptanceOrRejection) {
    const [idProvider] = CLIENT_NAME.split("-");

    const fileBuffer = await readFile(filePath);

    // convert to Base64
    const fileData = fileBuffer.toString("base64");
    superAcceptanaceData.body = {
      files: [
        {
          fileName: basename(filePath),
          fileData: fileData,
          fileExtension: 0,
          userCode: CLIENT_NAME,
          idAttachmentType: isAcceptance ? 14 : 21,
          languageCode: 1,
        },
      ],
      ...(!isAcceptance && {
        rejectionReason: {
          code: "3783",
          description: "Specialist Dr Unavailable",
          languageCode: 1,
        },
      }),
      referralId,
      providerName,
      idProvider: isAcceptance ? idProvider : undefined,
      notes: [],
      origin: "portal",
    };
  }

  let submissionButtonsRetry = 0;
  let checkDetailsPageRetry = 0;

  if (!isSupperAcceptanceOrRejection) {
    const remainingTimeMS = referralEndTimestamp - Date.now() - 80;

    if (remainingTimeMS > 0) {
      await sleep(remainingTimeMS);
    }
  }

  while (true) {
    const startTime = Date.now();
    try {
      if (
        !isSupperAcceptanceOrRejection &&
        (submissionButtonsRetry || checkDetailsPageRetry)
      ) {
        // console.log(
        //   `referralId=${referralId}_RETURNED_TO_HOME_times_${
        //     submissionButtonsRetry + checkDetailsPageRetry
        //   }`
        // );
        const referralIdRecordResultData = await collectHomePageTableRows(
          page,
          referralId
        );

        if (referralIdRecordResultData?.iconButton) {
          iconButton = referralIdRecordResultData?.iconButton;
        }
      }

      await iconButton.click();

      if (isSupperAcceptanceOrRejection) {
        console.time("🕒 super_acceptance_score_time");

        await updateSuperAcceptanceApiData(referralId, superAcceptanaceData);

        const buttonToClick = await helpIncreaseDetailsPageRecaptchaScore({
          page,
          cursor,
          actionName,
          isUploadFormOn: true,
        });
        console.timeEnd("🕒 super_acceptance_score_time");

        const remainingTimeMS = referralEndTimestamp - Date.now() - 70;

        console.log(
          `super_acceptance_left_time_${referralId}`,
          remainingTimeMS
        );

        if (remainingTimeMS > 0) {
          await sleep(remainingTimeMS);
        }

        if (buttonToClick) {
          await cursor.click(buttonToClick, {
            hesitate: 110 + Math.random() * 60,
            waitForClick: 100 + Math.random() * 60,
          });
        }

        const apiResult = await page.evaluate(
          async ({ apiUrl, body, headers }) => {
            const _grecaptcha = window.grecaptcha || grecaptcha;

            const safeReset = async () => {
              try {
                if (_grecaptcha && typeof _grecaptcha.reset === "function")
                  await _grecaptcha.reset();
              } catch {}
            };

            let token = null,
              execError = null;
            if (
              _grecaptcha &&
              typeof _grecaptcha.ready === "function" &&
              typeof _grecaptcha.execute === "function"
            ) {
              try {
                await new Promise((resolve) => _grecaptcha.ready(resolve));
                token = await _grecaptcha.execute(
                  "6LcqgMcqAAAAALsWwhGQYrpDuMnke9RkJkdJnFte",
                  { action: undefined }
                );
              } catch (err) {
                execError = err;
              }
            } else {
              execError = "grecaptcha not available on page";
            }

            const _body = JSON.stringify({ ...body, token });

            if (!token || execError) {
              await safeReset();
              const err = `Failed to get grecaptcha token: ${
                execError || "empty token"
              }`;
              return {
                error: err,
                success: false,
                apiData: {
                  recaptchaToken: token,
                  err,
                },
              };
            }

            try {
              const response = await fetch(apiUrl, {
                headers,
                method: "POST",
                body: _body,
              });
              if (!response.ok) {
                await safeReset();
                const responseText = await response.text();
                return {
                  success: false,
                  error: `Status ${response?.status}`,
                  apiData: {
                    recaptchaToken: token,
                    responseJson: responseText,
                  },
                };
              }
              const responseJson = await response.json();
              const { errorMessage, statusCode } = responseJson || {};
              const isSuccess = statusCode === "Success" && !errorMessage;
              await safeReset();

              return {
                error: errorMessage || "",
                success: !!isSuccess,
                _body,
                apiData: {
                  recaptchaToken: token,
                  responseJson,
                },
              };
            } catch (error) {
              await safeReset();
              return {
                error: `Error: ${error}`,
                success: false,
                _body,
                apiData: {
                  recaptchaToken: token,
                  responseJson: error.toString(),
                },
              };
            }
          },
          superAcceptanaceData
        );

        const { error, success, apiData } = apiResult;
        await updateSuperAcceptanceApiData(
          referralId,
          superAcceptanaceData,
          apiData
        );

        await handleOnSubmitDone({
          errorMessage: error,
          isAutoAccept: true,
          isDoneSuccessfully: success,
          startTime,
        });
        break;
      }

      const referralButtons = await getSubmissionButtonsIfFound(page);

      if (!referralButtons) {
        const hasReachedMaxRetriesForSubmission =
          submissionButtonsRetry >= MAX_RETRIES;

        if (hasReachedMaxRetriesForSubmission) {
          await sendErrorMessage(
            `Tried ${submissionButtonsRetry} times to find the submission buttons, but none were found.`,
            "submission-buttons-not-found-reachedMax",
            buildDurationText(startTime, Date.now())
          );

          await closeCurrentPage(true);
          break;
        }

        submissionButtonsRetry += 1;
        await goToHomePage(page);
        continue;
      }

      await selectAttachmentDropdownOption(page, actionName);

      const fileInput = await page.$('#upload-single-file input[type="file"]');
      await fileInput.uploadFile(filePath);

      const selectedButton = isAcceptance
        ? referralButtons[0]
        : referralButtons[1];

      await selectedButton.evaluate((el) => {
        el.scrollIntoView({ behavior: "auto", block: "center" });
      });

      await handleOnSubmitDone({
        startTime,
      });
      break;
    } catch (error) {
      try {
        const html = await page.content();
        await writeFile(`${htmlFilesPath}/details_page_catch_error.html`, html);
      } catch (error) {
        console.log("couldn't get details page html", error.message);
      }

      const _err = error?.message || String(error);

      console.log(`🛑 Error during ${actionName} of ${referralId}:`, _err);
      await sendErrorMessage(
        `Error: ${_err}`,
        `catch-error-${actionName}-error`,
        buildDurationText(startTime, Date.now())
      );
      await closeCurrentPage(false);
      break;
    }
  }
};

export default processClientActionOnPatient;

